import * as React from 'react';
import {
    DataGrid,
    GridToolbar,
    gridPageCountSelector,
    gridPageSelector,
    useGridApiContext,
    useGridSelector,
} from '@mui/x-data-grid';
import { 
    createTheme,
    ThemeProvider,
    } from '@mui/material/styles';
import {useState} from 'react'
import {useNavigate} from 'react-router-dom'
import Pagination from '@mui/material/Pagination';

const darkTheme = createTheme({
    palette: {
      primary: {
        main: "#fff",
      },
      type: "dark",
    },
  });

function CustomToolbar() {
  return (
    <GridToolbarContainer style={{color: 'white'}}>
      <GridToolbarColumnsButton />
      <GridToolbarFilterButton />
      <GridToolbarDensitySelector />
      <GridToolbarExport />
    </GridToolbarContainer>
  );
}
const columns = [
    {
      field: 'ticker',
      headerName: 'Ticker',
      width: 150,
      
    },
    {
        field: 'ceiling',
        headerName: 'Ceiling',
        type: 'number',
        width: 150,
        
      },
    {
      field: 'floor',
      headerName: 'Floor',
      type: 'number',
      width: 150,
     
    },
    {
      field: 'highest',
      headerName: 'Highest',
      type: 'number',
      width: 150,
      
    },
    {
      field: 'lowest',
      headerName: 'Lowest',
      type: 'number',
      width: 150,
      
    },
    {
      field: 'match',
      headerName: 'Match',
      type: 'number',
      width: 150,
      
    },
    {
      field: 'volume',
      headerName: 'Volume',
      type: 'number',
      width: 150,
    
    },
  ];
  const rows = [
    { id: 1, ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, match: 0.4, volume: 2300 },
    { id: 2, ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 900 },
    { id: 3, ticker: 'BVH', ceiling: 375, floor: 0.0, highest: 94, lowest: 0.0, match: 1.4, volume: 1000 },
    { id: 3, ticker: 'DGC', ceiling: 318, floor: 0.0, highest: 81, lowest: 2.0, match: 4.8, volume: 1500 },

    { id: 4, ticker: 'BCM', ceiling: 159, floor: 6.0, highest: 24, lowest: 4.0,match: 9.3,volume: 1200},
    { id: 5, ticker: 'BHN', ceiling: 356, floor: 16.0, highest: 49, lowest: 3.9,match: 1.4,volume: 700},
    
  ]; 
  function CustomPagination() {
    const apiRef = useGridApiContext();
    const page = useGridSelector(apiRef, gridPageSelector);
    const pageCount = useGridSelector(apiRef, gridPageCountSelector);
  
    return (
      <Pagination
        color="primary"
        count={pageCount}
        page={page + 1}
        onChange={(event, value) => apiRef.current.setPage(value - 1)}
      />
    );
  }

  export default function DataGridDemo() {
    const history = useNavigate()
    const [click, setClick] = useState(null)
    const handleOnClick = (param)=>{
      (history(`/stocks/${param}`))
    }

    return (

        <div style={{ height: 400, width: '100%'}}>

        <DataGrid
            initialState={{
                sorting: {
                  sortModel: [{ field: 'ticker', sort: 'asc' }],
                },
              }}
            sx={{
                color: 'white',
                font: "Monsterrat",
                display:'flex',
                fontWeight: 'bold',
                border: null,
                backgroundColor: 'black'
                }}
            rows={rows}
            columns={columns}

            components={{
            Toolbar: GridToolbar,
            color: 'white',
            }}
            pagination = {{
              color: 'white'
            }}
            onRowClick={(params) => 
              history(`/stocks/${params.row.ticker}`)
            }

        />
        </div>

    );
}
